import React, { useState } from "react";

const GRADES = ["Junior", "Senior", "Expert"];

export default function StaffManagement() {
  const [staffList, setStaffList] = useState([
    {
      id: 1,
      name: "Ravi",
      mobile: "9876543210",
      grade: "Senior",
      gender: "Male",
      active: true
    },
    {
      id: 2,
      name: "Anita",
      mobile: "9123456789",
      grade: "Junior",
      gender: "Female",
      active: true
    }
  ]);

  const [newStaff, setNewStaff] = useState({
    name: "",
    mobile: "",
    grade: "",
    gender: ""
  });

  const addStaff = () => {
    if (!newStaff.name || !newStaff.mobile || !newStaff.grade) return;

    setStaffList([
      ...staffList,
      {
        id: Date.now(),
        ...newStaff,
        active: true
      }
    ]);

    setNewStaff({ name: "", mobile: "", grade: "", gender: "" });
  };

  const toggleStatus = id => {
    setStaffList(
      staffList.map(s =>
        s.id === id ? { ...s, active: !s.active } : s
      )
    );
  };

  const removeStaff = id => {
    setStaffList(staffList.filter(s => s.id !== id));
  };

  return (
    <div className="card">
      <h3>Staff Management</h3>

      {/* Add Staff */}
      <div className="form-row">
        <input
          placeholder="Staff Name"
          value={newStaff.name}
          onChange={e =>
            setNewStaff({ ...newStaff, name: e.target.value })
          }
        />
        <input
          placeholder="Mobile Number"
          value={newStaff.mobile}
          onChange={e =>
            setNewStaff({ ...newStaff, mobile: e.target.value })
          }
        />
        <select
          value={newStaff.grade}
          onChange={e =>
            setNewStaff({ ...newStaff, grade: e.target.value })
          }
        >
          <option value="">Select Grade</option>
          {GRADES.map(g => (
            <option key={g} value={g}>
              {g}
            </option>
          ))}
        </select>
        <select
          value={newStaff.gender}
          onChange={e =>
            setNewStaff({ ...newStaff, gender: e.target.value })
          }
        >
          <option value="">Gender</option>
          <option>Male</option>
          <option>Female</option>
          <option>Other</option>
        </select>
        <button className="btn-primary" onClick={addStaff}>
          Add Staff
        </button>
      </div>

      {/* Staff Table */}
      <table className="table" style={{ marginTop: 20 }}>
        <thead>
          <tr>
            <th>Name</th>
            <th>Mobile</th>
            <th>Grade</th>
            <th>Gender</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {staffList.map(staff => (
            <tr key={staff.id}>
              <td>{staff.name}</td>
              <td>{staff.mobile}</td>
              <td>{staff.grade}</td>
              <td>{staff.gender}</td>
              <td>
                <button
                  onClick={() => toggleStatus(staff.id)}
                  style={{
                    background: staff.active ? "#ff4d00" : "#ccc",
                    color: "#fff",
                    border: "none",
                    padding: "4px 10px",
                    cursor: "pointer"
                  }}
                >
                  {staff.active ? "Active" : "Inactive"}
                </button>
              </td>
              <td>
                <button onClick={() => removeStaff(staff.id)}>
                  Delete
                </button>
              </td>
            </tr>
          ))}
          {staffList.length === 0 && (
            <tr>
              <td colSpan="6" align="center">
                No staff added
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
}
